  selector: 'app-products-add',
  templateUrl: './products-add.component.html',
  styleUrls: ['./products-add.component.scss']
})
export class ProductsAddComponent {
  products!: IProducts
  category!: any;
  submitValue: boolean = false;

  constructor(
    private productsService: ProductsService,
    private router
